import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import Navbar from './components/Navbar';
import { Home } from './components/Home';
import About from './components/About';


function App() {
  return (
    <>

    <Router>
         <Navbar /> 
         <Routes>
           <Route exact path="/">
             <Home />
           </Route>
           <Route exact path="/about">
             <About/>
           </Route> 
         </Routes>
       </Router>


    </>
  );
}

export default App;
